import React from 'react';
import ReactApexChart from 'react-apexcharts';
import ApexCharts from 'apexcharts';

const HeatMapChart = () => {
  const [options, setOptions] = React.useState({
    chart: {
      type: 'heatmap',
    },
    dataLabels: {
      enabled: false,
    },
    colors: ['#008FFB'],
    title: {
      text: 'HeatMap Chart',
    },
  });

  const [series, setSeries] = React.useState([
    {
      name: 'Series A',
      data: [
        { x: 'Jan', y: 10 },
        { x: 'Feb', y: 20 },
        { x: 'Mar', y: 30 },
        { x: 'Apr', y: 40 },
        { x: 'May', y: 50 },
        { x: 'Jun', y: 60 },
        { x: 'Jul', y: 70 },
        { x: 'Aug', y: 80 },
        { x: 'Sep', y: 90 },
        { x: 'Oct', y: 100 },
        { x: 'Nov', y: 110 },
        { x: 'Dec', y: 120 },
      ],
    },
  ]);

  return (
    <div>
      <ReactApexChart
        options={options}
        series={series}
        type="heatmap"
        height={350}
      />
    </div>
  );
};

export default HeatMapChart;
